import React from 'react';
import { Jumbotron, Container } from 'reactstrap';

const Example = (props) => {
  return (
    <div>
        <br></br>
      <Jumbotron fluid>
        <Container fluid>
          <h1 className="display-3" >ผู้เรียนต้องมีคุณสมบัติอย่างไร</h1>
          <p className="lead"> ไม่มีข้อกําหนดคุณสมบัติผู้เรียน เพียงแค่ท่านสนใจอยากเรียนรู้เกี่ยวกับการลงทุน และมีทักษะการใช้คอมพิวเตอร์บ้างเล็กน้อยก็สามารถเรียนได้</p>
        </Container>
      </Jumbotron>
      <Jumbotron fluid>
        <Container fluid>
          <h1 className="display-3">Fluid jumbotron</h1>
          <p className="lead">This is a modified jumbotron that occupies the entire horizontal space of its parent.</p>
        </Container>
      </Jumbotron>
      <Jumbotron fluid>
        <Container fluid>
          <h1 className="display-3">Fluid jumbotron</h1>
          <p className="lead">This is a modified jumbotron that occupies the entire horizontal space of its parent.</p>
        </Container>
      </Jumbotron> 
    </div>
  );
};

export default Example;
